import React from "react";
import "./App.css";
import Blog from "./pages/blog/index";
import Home from "./pages/home/index";
import { Route, Routes } from "react-router-dom";

const App = () => {
  return (
    <div className="App">
      <Routes>
        <Route path="/" component={<Home />} />
        <Route path="/blog/:id" component={<Blog />} />
      </Routes>
    </div>
  );
};

export default App;
